import React, { Component } from 'react'
import { Row, Col } from 'antd';
import Content from './content';
class AboutUs extends Component {
    render() {
        return (
            <div className="col-24 sections section-3">
                <Row className="rowWidth">
                    <Col xs={24} sm={24} md={24} lg={12} className="column-padding" >
                        <Content/>
                    </Col>
                    <Col xs={24} sm={24} md={24} lg={12} className="column-padding" >
                        <div>
                            <img src="https://lynagails-caters.s3-ap-southeast-1.amazonaws.com/uploads/Web_Stylegenie_Asia3_phone.png" className="aboutUsImage"/>
                        </div>
                    </Col>
                </Row>
            </div>
        )
    }
}

export default AboutUs
